​​​​​​여러번 에어프라이어에 고구마를 익혀먹고질릴때쯤 생각한 고구마 맛탕 ୧༼◕ ᴥ ◕༽୨​하지만 튀기는건 너무너무 귀찮은 일​요것도 에어프라이어에 해보자 , 하고 시도했음ㅋ(어차피 망해도 상관없음. 누구줄거아니니까^^)​​고구마를 감자칼로 쓱쓱 깎아 적당한 크기로 썰기에어프라이어에 종이호일 깔고 펼쳐주기180~190도에서 15분 뒤집어서 10분​​큰 그릇에 옮긴 후 물엿대신 꿀 두세스푼 넣기(건강하게 ^^ 가 아니라 우리집엔 물엿이없당 ㅋㅋ)​​먹지않고 쌓아둔 하루견과 두봉 빻아주기​​쉐킷쉐킷 후 맛있게 먹어주깅​​​아쉬운점 고구마맛탕은 노르스름해야 먹음직스러운데밤고구마로 했더니 색깔이 이쁘게 나오지않음호박고구마 추천!에어프라이어에 돌리니 수분이 날아가서 탱탱한 고구마맛탕이 아님 (혼자먹을거면 크게 상관없음)​​ 
